TRAMA:
Un coach di football americano diventato famoso con un video virale, si ritrova ad allenare una squadra di calcio in Premier League in Inghilterra senza nemmeno conoscerne le regole.
Pur uscendo dalla sua comfort zone, il protagonista cerca di dare il meglio anche quando non ha idea di cosa stia facendo.

GENERE:
Comedy, Drama, Sport

DURATA E PRODUZIONE:
La serie, composta da 10 episodi della durata di 30 minuti, viene distribuita settimanalmente su AppleTV+ dal 14 agosto 2020 al 2 ottobre 2020 (i primi tre episodi sono stati resi subito disponibili).
È già stata rinnovata per una seconda stagione

CAST:
Oltre al protagonista Jason Sudeikis, nella serie recitano Hannah Waddingham (Star System - Se non ci sei non esisti), Bronson Webb (Il Trono di Spade), Phil Dunster (Assassinio sull'Orient Express), e Stephen Manas.

CURIOSITÀ:
La serie di dieci episodi, creata dallo stesso Sudeikis insieme al famoso produttore Bill Lawrence (l'ideatore di Scrubs) e incentrata su un personaggio che lo stesso comico aveva creato per degli sketch proposti durante i programmi di NBC Sports.

Vi lascio il link del trailer: 
https://www.youtube.com/watch?v=PGrQNaSh5tk

