1. Leis de Jim Crow

A história se passa enquanto as leis de Jim Crow ainda estavam em vigor nos Estados Unidos. Criadas para segregar a população afro-americana, elas começaram a surgir após a Guerra Civil e a abolição da escravidão no país, assinada em 1863. A partir desse marco, leis estaduais e locais passaram a ser instituídas para separar negros e brancos em estabelecimentos, escolas, transportes, banheiros e até bedouros. As leis Jim Crow foram adotadas principalmente no Sul dos Estados Unidos e ficaram vigentes até a aprovação da Lei dos Direitos Civis de 1964. Ou seja, um século após o fim da escravidão no país.

2.Cidades do pôr do sol

Também criadas a partir do período de reconstrução do pós-guerra, as sundown towns eram cidades ou vilarejos que não permitiam a estadia de negros, intimidando a presença de pessoas não brancas por meio da violência e de leis segregacionistas locais. Até os anos 1960, era comum que esses lugares permitissem apenas a permanência de negros até o pôr do sol. No primeiro episódio, o trio protagonista é ameaçado por um policial de uma das cidades que tinham essa prática racista.

3. O Livro Verde do Motorista Negro

Mais conhecido após o lançamento do filme Green book (2018), a publicação foi criada pelo carteiro e escritor de viagens afro-americano Victor Hugo Green. O guia reunia indicações de lugares que aceitavam a estadia de viajantes negros, que frequentemente eram vítimas de discriminação em estradas, hotéis e restaurantes.

4. Denmark Vesey

O nome de um restaurante fictício de Lovecraft Country é uma homenagem ao homem que planejou a primeira grande revolta de escravos dos Estados Unidos, em 1822. Familiarizado com o movimento abolicionista do Haiti e leitor ávido de obras antiescravistas, Vesey conseguiu comprar sua liberdade por US$ 600 — e desde então lutou para que outras pessoas também a conquistassem.
Em 1822, liderou o plano de uma insurreição que pode ter envolvido até 9 mil escravos. Infelizmente, autoridades brancas souberam da revolta e reprimiram parte do movimento antes que a estratégia fosse posta em prática.";}i:121;a:1:{s:14:"comments_count";i:5;}i:122;a:1:{s:11:"likes_count";i:0;}i:123;a:1:{s:4:"link";s:39:"https://www.instagram.com/p/CEvWXnXJfU-";}i:124;a:1:{s:5:"image";s:238:"https://scontent-sin6-2.cdninstagram.com/v/t51.2885-15/e35/118879194_267383584273654_8898658361600769150_n.jpg?_nc_ht=scontent-sin6-2.cdninstagram.com&_nc_cat=110&_nc_ohc=61bzbjJHoGYAX94-Ox-&oh=02fd36ee2bc37b5a892035f44084331b&oe=5F551E1C";}i:125;a:1:{s:4:"type";s:5:"video";}i:126;a:1:{s:8:"owner_id";i:6369918773;}i:127;a:1:{s:14:"owner_username";s:0:"";}i:128;a:1:{s:14:"owner_fullname";s:0:"";}i:129;a:1:{s:9:"owner_pic";s:0:"";}i:130;a:1:{s:2:"id";s:19:"2391229213748283790";}i:131;a:1:{s:10:"short_code";s:11:"CEvWkz2AMmO";}i:132;a:1:{s:12:"created_time";i:1599276757;}i:133;a:1:{s:7:"caption";s:90:"Yo! How about #leikeli47 showin up on #lovecraftcountry !! Shit’s tight! #igotmoney #hbo";}i:134;a:1:{s:14:"comments_count";i:0;}i:135;a:1:{s:11:"likes_count";i:0;}i:136;a:1:{s:4:"link";s:39:"https://www.instagram.com/p/CEvWkz2AMmO";}i:137;a:1:{s:5:"image";s:249:"https://scontent-sin6-1.cdninstagram.com/v/t51.2885-15/e35/s1080x1080/118764604_351250972718267_4953641974034321243_n.jpg?_nc_ht=scontent-sin6-1.cdninstagram.com&_nc_cat=111&_nc_ohc=4D9DC5lA7mUAX8M62KN&oh=b7b8200be51686bdbe6b009bae35e86b&oe=5F7B2564";}i:138;a:1:{s:4:"type";s:5:"image";}i:139;a:1:{s:8:"owner_id";i:12295697;}i:140;a:1:{s:14:"owner_username";s:0:"";}i:141;a:1:{s:14:"owner_fullname";s:0:"";}i:142;a:1:{s:9:"owner_pic";s:0:"";}i:143;a:1:{s:2:"id";s:19:"2391228272379633146";}i:144;a:1:{s:10:"short_code";s:11:"CEvWXHIDx36";}i:145;a:1:{s:12:"created_time";i:1599276645;}i:146;a:1:{s:7:"caption";s:349:"R. I. P. PUBG #pubg #rip #published #pubggame #funnny #funny #cute #memesdaily #fun #memes #catolicos #aplicaciones #an